import React from 'react';
import './App.css';
import './bootstrap.min.css';
import Header from './header.js'
import Createpokemon from './Createpokemon.js'


class teambuilding extends React.Component{
	constructor(props){
		super(props);
		this.state = {
			view : [<Createpokemon/>]
			
		}
	}
	_displayPokemon (){
		this.setState({view : "<Createpokemon />"});
	}
	render(){
		return(
			<div>
				<Header currentState={this.state}/>
				<div>{this.state.view}</div>
			</div>
		)
	}	
}

export default teambuilding;
